import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "../../App.css";

const DataStoragePage = () => {
  const navigate = useNavigate();
  const [editingLogs, setEditingLogs] = useState({});
  const [uploadedFiles, setUploadedFiles] = useState([]);

  useEffect(() => {
    const storedLogs = JSON.parse(localStorage.getItem("editingLog") || "{}");
    const storedFiles = JSON.parse(localStorage.getItem("uploadedFiles") || "[]");
    setEditingLogs(storedLogs);
    setUploadedFiles(storedFiles);
  }, []);

  return (
    <div
      style={{
        backgroundColor: "#F0DFC3",
        fontFamily: "Proxima Nova",
        minHeight: "100vh",
        padding: "50px 100px",
        display: "flex",
        flexDirection: "column",
      }}
    >
      {/* Section: Editing History */}
      <div style={{ marginBottom: "50px" }}>
        <h1 style={headerStyle}>Editing History</h1>
        <div style={historyContainerStyle}>
          {Object.entries(editingLogs).map(([doc, edits]) => (
            <div key={doc} style={{ marginLeft: "20px" }}>
              <p
                style={{ cursor: "pointer" }}
                onClick={() => navigate("/editing-history", { state: { selectedDocument: doc } })}
              >
                {doc}
              </p>
              <div style={{ marginLeft: "30px" }}>
                {(edits || []).slice(0, 2).map((edit, i) => (
                  <p key={i} style={{ marginLeft: "20px" }}>
                    Line: <strong>{edit.line}</strong> — “{edit.from}” → “{edit.to}”
                  </p>
                ))}
                {edits.length > 2 && (
                  <p
                    style={showMoreStyle}
                    onClick={() => navigate("/editing-history", { state: { selectedDocument: doc } })}
                  >
                    Show more edits
                  </p>
                )}
              </div>
            </div>
          ))}
          {Object.keys(editingLogs).length === 0 && (
            <p style={{ fontSize: "24px", color: "#50464E" }}>No edits recorded yet.</p>
          )}
        </div>
        <p style={showAllStyle} onClick={() => navigate("/all-documents")}>
          Show all
        </p>
      </div>

      {/* Section: Uploaded Files */}
      <div style={{ marginBottom: "50px" }}>
        <h1 style={headerStyle}>Uploaded Files</h1>
        {uploadedFiles.length > 0 ? (
          <div style={fileGridStyle}>
            {uploadedFiles.map((file, i) => (
              <p key={i}>{file}</p>
            ))}
          </div>
        ) : (
          <p style={{ fontSize: "24px", color: "#50464E", textAlign: "center" }}>
            No files uploaded yet.
          </p>
        )}
        <p style={showAllStyle} onClick={() => navigate("/all-documents")}>
          Show all
        </p>
      </div>

      {/* Section: Back Button */}
      <div style={{ display: "flex", justifyContent: "flex-end", marginBottom: "25px" }}>
        <button style={buttonStyle} onClick={() => navigate("/")}>
          Back
        </button>
      </div>
    </div>
  );
};

// ✨ Styles
const headerStyle = {
  fontSize: "50px",
  fontWeight: "bold",
  color: "#A6785E",
  textAlign: "center",
  marginBottom: "25px",
};

const historyContainerStyle = {
  display: "flex",
  justifyContent: "space-between",
  marginBottom: "25px",
  color: "#50464E",
  fontSize: "30px",
  paddingLeft: "40px",
  paddingRight: "40px",
  flexWrap: "wrap",
};

const fileGridStyle = {
  display: "grid",
  gridTemplateColumns: "repeat(4, 1fr)",
  justifyItems: "center",
  fontSize: "30px",
  color: "#50464E",
  marginBottom: "25px",
  columnGap: "120px",
};

const showAllStyle = {
  textAlign: "center",
  fontSize: "30px",
  color: "#A6785E",
  cursor: "pointer",
  fontStyle: "italic",
  marginBottom: "25px",
};

const showMoreStyle = {
  color: "#A6785E",
  cursor: "pointer",
  fontStyle: "italic",
  marginLeft: "30px",
  marginTop: "25px",
};

const buttonStyle = {
  fontSize: "30px",
  backgroundColor: "#DEA93D",
  color: "#50464E",
  padding: "10px 30px",
  borderRadius: "10px",
  border: "none",
  cursor: "pointer",
  fontWeight: "bold",
};

export default DataStoragePage;
